import React from 'react';
import ReactDOM from 'react-dom';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import FormControl from 'react-bootstrap/FormControl';


const FirstDiv = () =>{
    return(
        <div className="ui fluid container" style={{background: "linear-gradient(90deg, rgba(2,0,36,1) 0%, rgba(9,33,121,1) 27%, rgba(0,140,255,1) 100%)", height: "60px"}}>
            <div className="ui fluid container">
                <Navbar variant="light">
                    <Navbar.Brand href="">The MAGICIAN</Navbar.Brand>
                    <Form inline style={{justifyContent:"flex-end"}}>
                        <FormControl type="text" placeholder="Search" className="mr-2" size="lg" inline/>
                        <Button variant="outline-info" size="lg" inline>Search</Button>
                    </Form>
                </Navbar>
            </div>
        </div>
    );
};

export default FirstDiv;
